import { TableCell, TableRow } from "@material-ui/core"
import { Skeleton } from "@material-ui/lab"
import styled from "styled-components"

const Wrapper = styled.div`
    height:250px;
    justify-content:center;
    align-items:center;
    display:flex;
    flex-direction:column;
`

const LoadingCell = () => (
    <TableCell><Skeleton /></TableCell>
)
const LoadingRow = () => (
    <TableRow>
        <LoadingCell />
        <LoadingCell />
        <LoadingCell />
        <LoadingCell />
        <LoadingCell />
        <LoadingCell />
    </TableRow>
)

const LoadingTable = () => {

    return (
        <>
            <TableRow>
                <LoadingCell />
                <LoadingCell />
                <LoadingCell />
                <LoadingCell />
                <LoadingCell />
                <LoadingCell />
            </TableRow>
        </>
    )
}


export default LoadingTable
